package leetcode.proplems.strings;

import static org.junit.jupiter.api.Assertions.assertEquals;

import java.util.Arrays;
import java.util.List;
import java.util.stream.Stream;

import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.Arguments;
import org.junit.jupiter.params.provider.MethodSource;

import leetcode.problems.strings.RepeatedDNASeq;

class RepeatedDNASeqTest {
	
	private RepeatedDNASeq underTest = new RepeatedDNASeq();
	
	@ParameterizedTest
	@MethodSource
	void testWithParams ( String input, List<String> expected) {
		List<String> actual = underTest.findRepeatedDnaSequences(input);
		
		assertEquals(expected, actual);
		
	}
	
	private static Stream<Arguments> testWithParams ( ) {
		return Stream.of(
			// less than 10 chars string
			Arguments.of("AAAA", Arrays.asList()),
			// 10 chars string, same char
			Arguments.of("CCCCCCCCCC", Arrays.asList()), // 10
			// 10 chars string, different chars
			Arguments.of("CCCCACCCGC", Arrays.asList()), // 10
			// more that 10 chars string, no repeatitions
			Arguments.of("CCCCCACCCCC", Arrays.asList()),
			// one repeated seq, sam char
			Arguments.of("CCCCCCCCCCC", Arrays.asList("CCCCCCCCCC")), // 11
			Arguments.of("CCCCCACCCCCACCCC", Arrays.asList("CCCCCACCCC")),
			Arguments.of("AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT", 
					Arrays.asList("AAAAACCCCC","CCCCCAAAAA")),
			Arguments.of("GATGGATACTGCATTCGAACCAGAGCCGGCTTTTGCGGGACTAGCATGAGGGACTTGG"
					+ "CTGTTGAGGCTGTACGAGGTCAGTCCTCCGGCAGTGCTATCGCAGGAATTTTTGCAACTCC"
					+ "ACTGCTTATAATCCACCAAGTCCAGACTCAAAGCTCAACTCGGGGATCGCACGGTATGGTC"
					+ "ACTGTCGCGCATGCAGTAATAGTCCAGACGAACGCACATTGGTCGTCCCCTGAGCCCGTGC"
					+ "CAGCCTAATACTTCTTATGCCTGCGTAAGTAGACTTTGCCAACGTAATCTCATCCTTATGC"
					+ "CAGATTATTAGTTCATTGAATGTCGGTCGCCGGCGCTCCCGCATTTCTTATCCGCGTATCT"
					+ "TGGGGTCAAGACGTCCCCAGCTTGTTAATACAAGCTACTTTCCCTCGCAATTACTAAGTTC"
					+ "GTGACAAGCGAATCACGCTAAGATGTTATTGGACTCTACAGAAATATTGAATTGACAACAT"
					+ "TCGTCTGTTCAGATCGTCGTTCACGCCACTGATAGCGCAGCTCGAGCACTCTGGAGCCACA"
					+ "ATGCGGAATGTCCAGAACCTTTGCGCAAGAGTCCGTGGAAAGCATAATCGTGAACAGAATG"
					+ "GCTAGCCGAGGTGCGCAAGGATAGGACCGTCTACACAAAGTATGGGCACCACGCACATCGA"
					+ "CACCCCGTAGTGTGTCAGTCGGCTCAGCGGCTAATGGGTTCGGCGTGAGGAATAGAAATAA"
					+ "TAGGCAGTGGTGCCAATTGTGGGGTCTTCTTTTGACTTTCTCATCTCTCTATGAATCAGAT"
					+ "",
					Arrays.asList())
			
		);
	}

}
